// ==UserScript==
// @name         florr.io | Shows current server you are in & Easily switch server
// @namespace    https://github.com/Samer-Kizi
// @version      1.1.0
// @description  Read title
// @author       sk
// @match        https://florr.io/*
// @grant        unsafeWindow
// @grant        GM_addStyle
// @license      MIT
// ==/UserScript==
var totalServers = 14 - 1,
    version = "1.1.0",
    pos = "-100px",
    keyPos = "-200px",
    background = [
        "data:image/svg+xml;base64,",
        "data:image/svg+xml;base64,",
        "data:image/svg+xml;base64,",
        "data:image/svg+xml;base64,",
        "data:image/svg+xml;base64,",
        "data:image/svg+xml;base64,",
        "data:image/svg+xml;base64,",
        "data:image/svg+xml;base64,",
        "data:image/svg+xml;base64,"
    ]
if (localStorage.getItem("florrKey") === null) localStorage.setItem('florrKey', JSON.stringify(['event.ctrlKey', 'event.shiftKey', 'true', 'true', 'Space', 'Tab', '0'])) // Ctrl, Shift, Alt, Meta, _, _, BGIdx
var keys = JSON.parse(localStorage.getItem("florrKey"))

let url;
const nativeWebSocket = unsafeWindow.WebSocket;
unsafeWindow.WebSocket = function(...args) {
    const socket = new nativeWebSocket(...args);
    url = socket.url
    return socket;
};

let cp6 = unsafeWindow.cp6
var keyPressed
document.documentElement.addEventListener("keydown", function(e) {
    keyPressed = e.code
    if (eval(keys[0]) && eval(keys[1]) && eval(keys[2]) && eval(keys[3]) && event.code == keys[4]) changeServer()
    if (event.code == keys[5]) getServerId() // https://www.toptal.com/developers/keycode
});

var doc = document.createElement('div')
doc.style = `
    width: 700px;
    height: auto;
    background-image: url(${background[Number(keys[6])]});
    background-size: 35%;
    z-index: 1;
    position: relative;
    border-radius: 5px;
    border: 6px solid rgba(0,0,0, 0.3);
    margin: 0 auto;
    color: white;
    text-align: center;
    font-family: 'Ubuntu';
    padding: 12px;
    text-shadow: rgb(0 0 0) 2px 0px 0px, rgb(0 0 0) 1.75517px 0.958851px 0px, rgb(0 0 0) 1.0806px 1.68294px 0px, rgb(0 0 0) 0.141474px 1.99499px 0px, rgb(0 0 0) -0.832294px 1.81859px 0px, rgb(0 0 0) -1.60229px 1.19694px 0px, rgb(0 0 0) -1.97998px 0.28224px 0px, rgb(0 0 0) -1.87291px -0.701566px 0px, rgb(0 0 0) -1.30729px -1.5136px 0px, rgb(0 0 0) -0.421592px -1.95506px 0px, rgb(0 0 0) 0.567324px -1.91785px 0px, rgb(0 0 0) 1.41734px -1.41108px 0px, rgb(0 0 0) 1.92034px -0.558831px 0px;
    top: ${pos};
    cursor: pointer;
    transition: all 1s ease-in-out;
`
document.querySelector('body').appendChild(doc)

doc.onclick = function() {
    keys[6] = (keys[6] + 1) % background.length
    background[Number(keys[6])]
    if (keys[6] == "4" || keys[6] == "6") doc.style.backgroundSize = "35%"
    doc.style.backgroundImage = "url(" + background[Number(keys[6])] + ")"
    container.style.backgroundImage = "url(" + background[Number(keys[6])] + ")"
    localStorage.setItem('florrKey', JSON.stringify(keys))
}

var message = document.createElement('div')
message.innerHTML = "Loading..."
doc.appendChild(message)

var keyButton = document.createElement('div')
keyButton.innerHTML = "Triggers"
keyButton.style = `
    width: fit-content;
    height: fit-content;
    padding: 8px 12px;
    background: rgb(219, 90, 90);
    border-radius: 5px;
    border: 6px solid rgb(177, 73, 73);
    right: -9px;
    bottom: 0px;
    position: absolute;
    transform: scale(0.7);
    z-index: 2;
`
keyButton.className = "button"
keyButton.onclick = function() {container.style.right = container.style.right === '20px' ? keyPos : '20px'}
doc.appendChild(keyButton)

var container = document.createElement('div')
container.style = `
    width: 150px;
    height: auto;
    position: absolute;
    top: 20px;
    right: ${keyPos};
    background-image: url(${background[Number(keys[6])]});
    background-size: 100%;
    border-radius: 5px;
    border: 6px solid rgba(0,0,0, 0.3);
    color: white;
    padding: 10px;
    font-family: 'Ubuntu';
    text-align: center;
    cursor: default;
    font-size: 18px;
    transition: all 1s ease-in-out;
    text-shadow: rgb(0 0 0) 2px 0px 0px, rgb(0 0 0) 1.75517px 0.958851px 0px, rgb(0 0 0) 1.0806px 1.68294px 0px, rgb(0 0 0) 0.141474px 1.99499px 0px, rgb(0 0 0) -0.832294px 1.81859px 0px, rgb(0 0 0) -1.60229px 1.19694px 0px, rgb(0 0 0) -1.97998px 0.28224px 0px, rgb(0 0 0) -1.87291px -0.701566px 0px, rgb(0 0 0) -1.30729px -1.5136px 0px, rgb(0 0 0) -0.421592px -1.95506px 0px, rgb(0 0 0) 0.567324px -1.91785px 0px, rgb(0 0 0) 1.41734px -1.41108px 0px, rgb(0 0 0) 1.92034px -0.558831px 0px;
`
container.innerHTML =
    `
    Triggers<br>
    <a id="ctrlKey0" class="keys">ctrlKey</a><br>
    <a id="shiftKey1" class="keys">shiftKey</a><br>
    <a id="altKey2" class="keys">altKey</a><br>
    <a id="metaKey3" class="keys">metaKey</a><br>
    `
container.id = "container"
document.querySelector('body').appendChild(container)

var key1 = document.createElement('div')
key1.id = "key14"
key1.innerHTML = `<a id="key1" class="keys">Key1: </a><a id="k1" class="keys" style="color:#FCDF03">${keys[4]}</a><br>-<br>`
container.appendChild(key1)

var key2 = document.createElement('div')
key2.id = "key25"
key2.innerHTML = `<a id="key2" class="keys">Key2: </a><a id="k2" class="keys" style="color:#FCDF03">${keys[5]}</a><br>`
container.appendChild(key2);

['ctrlKey0', 'shiftKey1', 'altKey2', 'metaKey3'].forEach(x => {
    var keyIndexs = ['ctrlKey0', 'shiftKey1', 'altKey2', 'metaKey3'].indexOf(x)
    if (keys[keyIndexs] != "true") document.getElementById(x).classList.add("actived")
    document.getElementById(x).onclick = function() {
        this.classList.toggle('actived')
        if(!this.classList.contains('actived')) keys[Number(this.id.at(-1))] = 'true'
        else keys[Number(this.id.at(-1))] = 'event.' + this.id.slice(0, -1)
        localStorage.setItem('florrKey', JSON.stringify(keys))
    }
});

['k1', 'k2'].forEach(x => {
    document.getElementById(x).onclick = function() {
        var currentElement = this,
            startTime = Date.now() + 5*1000
        this.innerText = "Press a Key!"
        var keyArr = []
        var keyInterval = setInterval(function() {
            keyArr.unshift(keyPressed)
            if (keyArr.length > 2) keyArr.splice(2)
            if (keyArr.at(-1) != keyArr[0]) {
                keys[Number(currentElement.parentNode.id.at(-1))] = keyPressed
                currentElement.innerText = keys[Number(currentElement.parentNode.id.at(-1))]
                localStorage.setItem('florrKey', JSON.stringify(keys))
                clearInterval(keyInterval)
            }
            if (Date.now() > startTime) {
                currentElement.innerText = keys[Number(currentElement.parentNode.id.at(-1))]
                clearInterval(keyInterval)
            }
        }, 0);
    }
})

var servers = [],
    mapName,
    regionName,
    codeA = [],
    code,
    changeServerCode;
for (let i = 0; i <= totalServers; i++) {fetch("https://api.n.m28.io/endpoint/florrio-map-" + i + "-green/findEach/").then((response) => response.json()).then((data) => {servers[i] = `${data.servers["vultr-miami"].id} ${data.servers["vultr-frankfurt"].id} ${data.servers["vultr-tokyo"].id}`})};
function getServerId() {
    var wssUrl = url.slice(6, 9)
    servers.forEach(function callback(x, index) {
        if (x.includes(wssUrl)) {
            mapName = "MAP" + index
            codeA = x.split(" ")
            if (wssUrl == codeA[0]) regionName = "NA"
            else if (wssUrl == codeA[1]) regionName = "EU"
            else if (wssUrl == codeA[2]) regionName = "AS"
        }
    });
    message.innerHTML = `Connected to ${regionName} ${mapName}<br>${url.slice(6,-1)} - <a style="color:#2BFFA3">v${version}</a>`
    doc.style.top = doc.style.top === '0px' ? pos : '0px'
}

function changeServer() {
    changeServerCode = prompt('Input server name: na/eu/as?')
    if (changeServerCode.toLowerCase() == 'na') cp6.forceServerID(servers[1].split(" ")[0])
    else if (changeServerCode.toLowerCase() == 'eu') cp6.forceServerID(servers[1].split(" ")[1])
    else if (changeServerCode.toLowerCase() == 'as') cp6.forceServerID(servers[1].split(" ")[2])
}

document.querySelector('canvas').onclick = function() {
    doc.style.top = pos
    container.style.right = keyPos
}

var urlA = []
setInterval(function() {
    urlA.unshift(url)
    if (urlA.length > 2) urlA.splice(2)
    if (urlA.at(-1) != urlA[0]) {
        getServerId()
        doc.style.top = '0px'
    }
}, 1000)

GM_addStyle(`
.button:hover {
  filter: brightness(1.05);
}
.actived {
  color: #2BFFA3!important;
}
.keys {
  color: white;
  font-size: 14px;
  opacity: 0.8;
}
.keys:hover {
  color: white;
  opacity: 1;
  cursor: pointer;
}
`)